  "text" : "\uCC38 \uC774\uD574\uD558\uAE30\uAC00 \uD798\uB4E0 \uBD84\uB4E4\uC774\uC57C \uAE68\uC2DC\uBBFC \uBD84\uB4E4\uC740.. \uD56D\uC0C1 \uD5CC\uBC95\uACFC \uD5CC\uBC95\uC0C1 \uAD8C\uB9AC, \uADF8\uB9AC\uACE0 \uBBFC\uC8FC\uC8FC\uC758\uB97C \uC785\uC5D0 \uB2EC\uACE0 \uC0AC\uC2DC\uC9C0\uB9CC- \uD558\uB294 \uD589\uB3D9\uB4E4\uC740 \uB300\uBD80\uBD84 \uBC18\uD5CC\uBC95, \uBC18\uBBFC\uC8FC\uC8FC\uC758\uC758 \uBC14\uC774\uBE14\uC778 \uB4EF. \"\uB2C8\uB4E4\uC774 \uD558\uBA74 \uBD88\uB95C\uC774\uC9C0\uB9CC, \uC6B0\uB9AC\uAC00 \uD558\uBA74 \uB85C\uB9E8\uC2A4\uB2E4\"",
