  "text" : "\uAE68\uC2DC\uBBFC \uC5EC\uB7EC\uBD84\uB4E4 \uD5CC\uBC95 \uC88B\uC544\uD558\uC2DC\uACE0, \uD5CC\uBC95\uC0C1 \uAD8C\uB9AC\uB97C \uC774\uC57C\uAE30 \uD558\uAE30\uB3C4 \uC88B\uC544\uD558\uC2DC\uC8E0? \uADFC\uB370 \uC5EC\uB7EC\uBD84\uC774 \uC88B\uC544\uD558\uB294 \uC815\uCE58\uC778\uC774 \uAD6C\uC18D\uB418\uBA74 \uBB34\uC8C4\uCD94\uC815\uC758 \uC6D0\uCE59\uC744 \uBAA9\uB193\uC544 \uC6B8\uBD80\uC9D6\uC73C\uC2DC\uBA74\uC11C, \uC65C \uC870\uD604\uC624\uC5D0\uAC8C\uB294 \uADF8\uC758 \uD5CC\uBC95\uC0C1 \uAD8C\uB9AC\uC778 \uBC29\uC5B4\uAD8C\uC774\uB098 \uBB34\uC8C4\uCD94\uC815\uC758 \uC6D0\uCE59 \uB4F1\uC744 \uC9C0\uCF1C\uC8FC\uB824 \uD558\uC9C0 \uC54A\uC73C\uC2DC\uB098\uC694?",
