  "text" : "\uB0C9\uC815\uD55C\uAC8C \uB098\uC05C\uAC74 \uC544\uB2C8\uC5D0\uC694. \uB2F9\uC2E0\uC774 \uBC14\uBCF4\uAC00 \uB418\uAC70\uB098 \uB0A8\uC5D0\uAC8C \uC774\uC6A9\uB2F9\uD560 \uC77C\uC744 \uB9C9\uC544\uC8FC\uBA70, \uC815\uC758\uB97C \uC218\uD638\uD55C\uB2E4\uB294 \uCC29\uAC01 \uD558\uC5D0 \uBD88\uC758\uB97C \uC800\uC9C0\uB974\uB294 \uC624\uB958\uC5D0\uC11C \uBC97\uC5B4\uB0A0 \uC218 \uC788\uAC8C \uD574\uC8FC\uB2C8\uAE4C\uC694. \uD2B8\uC717\uC5D0 \uC62C\uB77C\uC624\uB294 \uC218\uB9CE\uC740 \uBD88\uC0C1(\u4E0D\u8A73)\uC758 \uAE00\uB4E4\uC5D0\uAC8C \uC774\uB9AC\uC800\uB9AC \uD718\uB458\uB9AC\uC9C4 \uB9D9\uC2DC\uB2E4.",
