  "text" : "\uC7AC\uAC1C\uBC1C \uC0AC\uC5C5\uC758 \uACC4\uD68D\uC774\uB098 \uACE0\uC2DC\uAC00 \uBB50 \uAD00\uD560\uCCAD\uC5D0 \uD2B9\uBCC4\uD788 \uC5F0\uC904\uC774 \uC788\uC5B4\uC57C \uC54C \uC218 \uC788\uB2E4\uAC70\uB098, \uC544\uB2C8\uBA74 \uC81C\uC784\uC2A4 \uBCF8\uB4DC\uB97C \uACE0\uC6A9\uD558\uC5EC \uC54C\uC544\uB0B4\uC57C \uD558\uB294 \uC0AC\uC2E4\uB3C4 \uC544\uB2C8\uACE0.. \uC544\uC8FC \uC57D\uAC04\uC758 \uC218\uACE0\uB85C \uC54C \uC218 \uC788\uB294- \uADF8\uC815\uB3C4\uC870\uCC28 \uC54C\uC544\uBCF4\uC9C0 \uC54A\uC558\uB2E4\uB294 \uAC83\uC740 \uC800\uBD84\uC758 \uC911\uACFC\uC2E4\uB85C \uBD10\uC57C \uD560 \uAC83 \uAC19\uC740\uB370\uC694.",
