  "text" : "\uC815\uD655\uD55C \uC0AC\uC2E4\uAD00\uACC4\uAE4C\uC9C0\uB294 \uC798 \uBAA8\uB974\uACA0\uC9C0\uB9CC, \uC77C\uBC29\uC758 \uB9D0\uB9CC \uB4E3\uACE0 \uAC70\uAE30 \uAC00\uC11C \uC73C\uC330\uC73C\uC330\uB97C \uD558\uACA0\uB2E4\uB294 \uAC83\uC740 \uBC14\uBCF4\uAC19\uC740 \uC9D3\uC774 \uB420 \uC218\uB3C4 \uC788\uC5B4\uC694. \uCDA9\uBD84\uD788 \uBC95\uC801\uC73C\uB85C \uAD6C\uC81C\uB97C \uBC1B\uC744 \uC218 \uC788\uB294 \uC0C1\uD669\uC73C\uB85C \uBCF4\uC774\uB294\uB370, \uADF8\uB7EC\uC9C0 \uC54A\uB294\uB2E4\uB294 \uAC83\uC740 \uB4A4\uC5D0 \uC228\uACA8\uC9C4 \uBB54\uAC00\uAC00 \uB610 \uC788\uC744 \uC218\uB3C4 \uC788\uB2E4\uB294 \uC774\uC57C\uAE30.",
