  "text" : "\uBC29\uAE08 \uC11C\uC788\uB294\uB370 \uAC11\uC790\uAE30 \uC138\uC0C1\uC774 \uD55C\uBC14\uD034 \uB3CC\uB354\uB77C. \uB0B4\uAC00 \uAE38 \uD55C\uAC00\uC6B4\uB370\uC5D0\uC11C \uD5E4\uB4DC\uC2A4\uD540\uC744 \uD55C\uAC74 \uC544\uB2D0\uD14C\uB2C8.... \uC544\uBB34\uB798\uB3C4 \uB0B4\uAC00 \uC694\uC998 \uB108\uBB34 \uCCB4\uB825\uC744 \uC18C\uC9C4\uD588\uB098\uBCF4\uB2E4. \uC774\uB97C \uC5B4\uCA4C\uBA74 \uC88B\uC744\uAF2C... \uBB34\uC5C7\uBCF4\uB2E4 \uC7A0\uC774 \uB108\uBB34\uB108\uBB34\uB108\uBB34 \uBD80\uC871\uD574\uC694.",
