  "id_str" : "304916977959444481",
  "text" : "[\uCE74\uD22C\uC0AC\uAD34\uB2F4] \uD558\uC9C0\uB9CC \uC7A5\uAD50(Officer)\uB4E4\uC740 \uBC30\uC18D\uC774 \uC544\uB2CC \uD30C\uACAC\uC758 \uD615\uD0DC\uB85C \uADFC\uBB34\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uB530\uB77C\uC11C \uBBF8\uAD70\uC740 \uBC30\uC18D\uB41C \uCE74\uD22C\uC0AC(\uBCD1\uC0AC\uC640 \uBD80\uC0AC\uAD00)\uC5D0 \uB300\uD55C \uC9C0\uD718\uAD8C\uC744 \uAC00\uC9C0\uACE0 \uC788\uC9C0\uB9CC, \uBBF8\uAD70\uC5D0 \uD30C\uACAC\uB41C \uD55C\uAD6D\uAD70 \uC7A5\uAD50\uC5D0 \uB300\uD55C \uC9C0\uD718\uAD8C\uC740 \uAC00\uC9C0\uACE0 \uC788\uC9C0 \uC54A\uC544\uC694. (\uC804\uC2DC\uC5D0\uB294 \uC608\uC678)",
