  "text" : "[\uCE74\uD22C\uC0AC\uAD34\uB2F4] \uCC38\uACE0\uB85C \uCE74\uD22C\uC0AC\uB294 Korean Augmentation to the United States Army(\uBBF8\uC721\uAD70\uC5D0 \uBC30\uC18D\uB41C \uD55C\uAD6D\uAD70 \uC694\uC6D0)\uC758 \uC57D\uC790\uC785\uB2C8\uB2E4. \uC885\uC885 \uCE74\uCE04\uC0AC\uB098 \uCE74\uD29C\uC0AC\uB85C \uBD80\uB974\uB294 \uBD84\uB4E4\uC774 \uACC4\uC2DC\uB294\uB370, \uCE74\uD22C\uC0AC\uC5D0\uC694 \u3160 \uCE74\uCE04\uC0AC\uB098 \uCE74\uCD94\uC0AC \uB4E3\uAE30 \uC2EB\uC5B4\uC694 \u3160",
