  "text" : "\uC18C\uC11C\uB9AC\uC2A4\uB294 \uADF8 \uC606\uC5D0\uC11C \uC624\uBE0C \uB0A0\uB9AC\uBA74\uC11C \uBA54\uD14C\uC624 \uB9C9 \uB5A8\uAD6C\uACE0, \uBC14\uBC14\uB9AC\uC548\uC740 \uCD5C\uC804\uBC29\uC5D0\uC11C \uBBF8\uCE5C\uB4EF\uC774 \uC18C\uB9AC \uC9C0\uB974\uBA74\uC11C \uC30D\uCE7C \uD718\uB450\uB974\uACE0, \uB4DC\uB8E8\uC774\uB4DC\uAC00 \uC18C\uD658\uD55C \uB291\uB300\uB791 \uACF0\uC774 \uC5EC\uAE30\uC800\uAE30\uC11C \uBB3C\uC5B4\uB72F\uACE0 \uC788\uACE0 \uADF8\uB7EC\uBA74 \uC9C4\uC9DC \uC7AC\uBBF8\uC788\uACA0\uB2E4. \uADF8\uB7EC\uBA74\uC11C \uC2F9\uD2B8\uB294 \uD314\uB77C\uB518\uACFC \uC18C\uC11C\uB9AC\uC2A4\uC758 \uAE08\uC9C0\uB41C \uC0AC\uB791..\u314B\u314B",
