  "text" : "\uAC1C\uC778\uC801\uC73C\uB85C\uB294 \uB514\uC544\uBE14\uB85C 2\uB97C \uAC00\uC7A5 \uC7AC\uBBF8\uC788\uAC8C \uD50C\uB808\uC774 \uD588\uC73C\uBBC0\uB85C(3\uB294 \uC548\uD574\uBD24\uC74C), \uB514\uC544\uBE14\uB85C 2\uC758 \uCE90\uB9AD\uD130\uB4E4\uC774 \uC601\uD654\uC5D0 \uB098\uC640\uC92C\uC73C\uBA74 \uC88B\uACA0\uB2E4. \uD314\uB77C\uB518\uC774 \uB098\uC640\uC11C \uBE14\uB808\uC2A4\uB4DC \uD574\uBA38 \uBE59\uBE59 \uB3CC\uB9AC\uBA74\uC11C \uCC28\uC9D5\uD558\uACE0, \uC5B4\uC314\uC2E0\uC740 \uD2B8\uB7A9 \uAE54\uBA74\uC11C \uD719\uD719 \uB0A0\uC544\uB2E4\uB2C8\uACE0, \uB4A4\uC5D0\uC11C \uB124\uD06C\uB85C\uB9E8\uC11C\uAC00 \uC800\uC8FC \uAC78\uACE0",
