  "text" : "\uBC95\uC870\uC778, \uD2B9\uD788 \uD310\uC0AC\uC758 \uC2E0\uC6D0\uC740 \uC815\uB9D0 \uCCA0\uC800\uD558\uAC8C \uBCF4\uD638\uD574 \uC904 \uD544\uC694\uAC00 \uC788\uB294 \uAC83 \uAC19\uB2E4. \uBB54 \uC77C\uB9CC \uD130\uC9C0\uBA74 \uC800 \uD310\uC0AC\uAC00 \uC5B4\uB290 \uD559\uAD50\uB97C \uB098\uC654\uACE0, \uC774\uC804\uC5D0 \uBB34\uC2A8 \uD310\uACB0\uC744 \uB0B4\uB838\uACE0, \uC640\uC774\uD504\uB294 \uB204\uAD6C\uACE0 \uB4F1\uB4F1\uC744 \uCE90\uB0B4\uB294 \uC774 \uBCD1\uC2E0 \uB610\uB77C\uC774 \uAC19\uC740 \uC9D3\uAC70\uB9AC\uB4E4\uC744 \uC5B8\uC81C\uAE4C\uC9C0 \uBD10\uC57C \uD558\uB098.",
