  "text" : "\uBC14\uB78C\uC740 \uC544\uBB34\uB098 \uBABB\uD53C\uB294 \uAC83 \uAC19\uB2E4. \uC678\uBAA8\uB098 \uC7AC\uB825 \uB4F1\uC758 \uBB38\uC81C\uAC00 \uC544\uB2C8\uB77C- \uC21C\uAC04\uC801\uC778 \uC0C1\uD669\uD310\uB2E8 \uB2A5\uB825\uACFC \uC218\uC2B5 \uB2A5\uB825, \uAC70\uC9D3\uB9D0 \uC2A4\uD0AC, \uADF8\uB9AC\uACE0 \uB6F0\uC5B4\uB09C \uB2F4\uB825\uC774 \uD544\uC694\uD558\uB2E4. \uB09C \uBC14\uB78C \uB531 \uD55C\uBC88 \uD53C\uC6CC\uBCF8 \uB4A4\uB85C\uB294 \uB098\uC5D0\uAC8C\uB294 \uBC14\uB78C\uC758 \uC790\uC9C8\uC774 \uC5C6\uB2E4\uB294 \uAC83\uC744 \uAE68\uB2EB\uAC8C \uB418\uC5C8\uACE0, \uADF8 \uC774\uD6C4\uB85C\uB294 \uD3EC\uAE30",
