  "text" : "\uC5F0\uC560\uB97C \uD558\uAC8C \uB418\uBA74 \uAD6C\uC18D\uACFC \uAC04\uC12D\uC744 \uC990\uAE34\uB2E4\uB294 \uB9D0\uC740 \uACE7 \uC5F0\uC560\uB97C \uD558\uC9C0 \uC54A\uB294 \uC0C1\uD0DC\uC5D0\uC11C\uB294 \uAD6C\uC18D\uACFC \uAC04\uC12D\uC5D0 \uACBD\uAE30\uB97C \uC77C\uC73C\uD0A4\uAC8C \uB418\uB354\uB77C\uB294 \uC774\uC57C\uAE30. \uADFC\uB370 \uC774\uAC8C \uC5B4\uCC0C\uBCF4\uBA74 \uC21C\uD658\uC774 \uB420 \uC218 \uBC16\uC5D0 \uC5C6\uB294 \uAC83\uC774.. \uC5F0\uC560\uB97C \uC548\uD560 \uB54C \uB108\uBB34\uB098 \uC790\uC720\uBD84\uBC29\uD558\uAC8C \uC9C0\uB0C8\uAE30 \uB54C\uBB38\uC5D0, \uADF8 \uB54C \uB2F9\uC2DC \uC378\uC744",
