  "text" : "\uC560\uC778\uC774 \uC704\uCE58\uCD94\uC801 \uC5B4\uD50C\uC744 \uD558\uB8E8\uC885\uC77C \uB4E4\uC5EC\uB2E4\uBCF4\uACE0 \uC788\uB294 \uAC83\uB3C4 \uC544\uB2C8\uACE0, \uC5B4\uCC28\uD53C \uB098\uB294 \uC5B4\uB514 \uAC08 \uB54C\uC5D0\uB294 \uC5B4\uB51C \uAC00\uC11C \uB204\uAD74 \uB9CC\uB09C\uB2E4\uACE0 \uBCF4\uACE0\uB97C \uD558\uACE0 \uB3CC\uC544\uB2E4\uB2C8\uB294 \uD3B8\uC774\uAE30\uC5D0 \uC704\uCE58\uCD94\uC801\uC744 \uB2F9\uD574\uB3C4 \uBCC4 \uBB38\uC81C\uAC00 \uC5C6\uC5C8\uC74C. \uC704\uCE58\uCD94\uC801 \uD558\uB2E4\uAC00 \uACB0\uAD6D \uC790\uAE30\uAC00 \uBA3C\uC800 \uC9C0\uACA8\uC6CC\uC11C \uB098\uAC00 \uB5A8\uC5B4\uC9C0\uAC8C \uB418\uB354\uB794\u314B",
