  "text" : "\uB098\uB294 \uC5F0\uC560\uB97C \uC2DC\uC791\uD558\uBA74 \uC758\uC2EC\uBC1B\uC744 \uC9D3\uC744 \uC548\uD558\uB824\uB294 \uC131\uACA9\uC778\uC9C0\uB77C, \uC560\uC778\uC774 \uB0B4 \uD3F0\uC5D0 \uC704\uCE58\uCD94\uCC99 \uBC0F \uC2A4\uD30C\uC774 \uC5B4\uD50C\uC744 \uAE54\uC544\uB3C4 \uC81C\uC9C0\uD558\uC9C0 \uC54A\uB294 \uD3B8. \uC544\uC774\uD3F0 \uC4F8 \uB54C\uC5D0\uB294 \uAD6C\uAE00 \uB798\uD2F0\uD29C\uB4DC\uC600\uB098? \uC2E4\uC2DC\uAC04 \uC704\uCE58 \uCD94\uC801\uC774 \uB418\uB294 \uC5B4\uD50C\uC744 \uC37C\uC5C8\uC74C. \uC5B4\uCC28\uD53C \uB098\uB984 \uBE64\uD788 \uBCF4\uC774\uB294 \uC0B6\uC744 \uC0B4\uACE0\uC788\uAE30\uC5D0..",
