  "text" : "\uCC98\uBC8C\uADDC\uC815 \uADF8 \uC790\uCCB4\uB294 \uADF8\uB300\uB85C \uB450\uB418- \uD559\uACC4\uC640 \uC2DC\uBBFC\uC0AC\uD68C, \uBC95\uC6D0\uC774 \uBC15\uC790\uB97C \uB9DE\uCD94\uC5B4 \uBC95\uC6D0\uC758 \uC591\uD615\uAE30\uC900\uC744 \uC880 \uB354 \uD0C4\uB825\uC801\uC73C\uB85C \uC870\uC808\uD55C\uB2E4\uB358\uAC00, \uC544\uB2C8\uBA74 \uC704\uBC95\uC131 \uC870\uAC01\uC0AC\uC720 \uB4F1\uC758 \uC778\uC815\uBC94\uC704\uC640 \uC815\uB3C4\uB97C \uC880 \uB354 \uC720\uB3C4\uB9AC\uC788\uAC8C \uD574\uC11D\uD558\uB3C4\uB85D \uBC14\uAFB8\uB294 \uAC83\uC774 \uB354 \uC548\uC804\uD558\uC9C0 \uC54A\uB098 \uC2F6\uB124\uC694 @seungow",
