  "text" : "\uC9C0\uB098\uCE5C \uC5C4\uBC8C\uC8FC\uC758\uAC00 \uC720\uD589\uC774 \uB41C \uC0AC\uD68C\uAC00 \uBD88\uB9CC\uC2A4\uB7FD\uC9C0\uB9CC, \uAF2D \uD544\uC694\uD558\uB2E4\uACE0 \uC0DD\uAC01\uB418\uB294 \uBD80\uBD84\uC5D0 \uB300\uD55C \uD3D0\uC9C0\uB098 \uC57D\uD654\uC758 \uC8FC\uC7A5\uB3C4 \uACBD\uACC4\uD558\uB294 \uD3B8\uC785\uB2C8\uB2E4. \uBA85\uD655\uD788 \uC704\uD5CC\uC801\uC778 \uC694\uC18C\uB97C \uAC00\uC9C0\uACE0 \uC788\uB294 \uAC83\uC774 \uC544\uB2C8\uB77C\uBA74, \uCC98\uBC8C\uADDC\uC815 \uADF8 \uC790\uCCB4\uB294 \uAC00\uB2A5\uD558\uBA74 \uD604\uC0C1\uD0DC\uB97C \uC720\uC9C0\uD558\uB294 \uAC83\uC774 \uC88B\uB2E4\uACE0 \uC0DD\uAC01\uD574\uC694.",
