  "text" : "\uC5EC\uB7EC\uBD84\uC774 SNS\uC5D0 \uB5A0\uB3C4\uB294 \"\uC81C\uAC00 \uC774 \uC0AC\uB78C\uC5D0\uAC8C \uB2F9\uD588\uC5B4\uC694. \uADF8\uB7EC\uB2C8\uAE4C \uC774 \uC0AC\uB78C \uC870\uC2EC\uD558\uC138\uC5EC-\" \uB958\uC758 \uC815\uBCF4\uB97C \uBB34\uD131\uB300\uACE0 \uBBFF\uAE30\uC5D0\uB294 (\uADF8\uB7EC\uD55C \uB300\uC911\uC744 \uC774\uC6A9\uD558\uB824\uB294) \uC774\uC0C1\uD55C \uC0AC\uB78C\uB4E4\uC774 \uB108\uBB34\uB098 \uB9CE\uC740 \uC138\uC0C1\uC785\uB2C8\uB2E4.",
