  "text" : "\uBB50 \uC774\uB7EC\uADF8\uB7EC\uC800\uB7EC\uD55C \uC774\uC720\uB85C \uC778\uD574 \uD398\uBD81\uC774\uB098 \uD2B8\uC704\uD130 \uB4F1\uC758 SNS \uC0C1\uC5D0\uC11C \uB5A0\uB3CC\uC544\uB2E4\uB2C8\uB294 \"\uC774\uB188\uC880 \uBD10\uC8FC\uC138\uC5EC, \uC774\uB188 \uB098\uC05C \uB188\uC774\uC5D0\uC694. \uB110\uB9AC\uB110\uB9AC \uC54C\uB824\uC8FC\uC138\uC694\" \uB958\uB294 \uC808\uB300 \uC2E0\uB8B0\uD558\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4. \uB300\uCCB4 \uBB58 \uBBFF\uACE0 \uADF8\uB807\uAC8C \uD37C\uB2E4 \uB098\uB974\uB294 \uAC70\uC5D0\uC694? \uB204\uAC00 \uB0A8 \uC5FF\uBA39\uC77C\uB824\uACE0 \uB9CC\uB4E0\uAC70\uBA74 \uC5B4\uCA4C\uB824\uACE0",
