  "text" : "\uC5EC\uD2BC, \uBA85\uC608\uD6FC\uC190\uC5D0 \uB300\uD55C \uC9D5\uC5ED\uD615 \uC120\uACE0\uAC00 \uADF8\uB807\uAC8C \uC73C\uC545\uD558\uAC8C \uB290\uAEF4\uC9C8 \uC0AC\uC548\uC740 \uC544\uB2CC \uB4EF. \uADF8\uB9AC\uACE0 \uC77C\uBC18\uC778\uB4E4\uC5D0\uAC8C\uB294 \uADF8\uC815\uB3C4\uB85C\uAE4C\uC9C0 \uC9D5\uC5ED\uD615 \uBE75\uBE75 \uC548\uB54C\uB824\uC694. \uD569\uC758\uD558\uC5D0 \uB05D\uB098\uAC70\uB098, \uD569\uC758\uAC00 \uC548\uB418\uB354\uB77C\uB3C4 \uCD08\uBC94\uC758 \uACBD\uC6B0\uC5D0\uB294 \uBC8C\uAE08\uD615 \uC120\uC5D0\uC11C \uB05D\uB098\uB294 \uACBD\uC6B0\uAC00 \uB9CE\uC8E0.",
