  "text" : "\uAD73\uC774 \uC608\uB97C \uB4E4\uC790\uBA74.. \uB2D8\uACFC \uC0AC\uC774\uAC00 \uC548\uC88B\uC740 \uC0AC\uB78C\uC774 \uC788\uC5B4\uC694. \uADFC\uB370 \uADF8 \uC0AC\uB78C\uC774 \uB2D8\uAED8 \uBE45\uC5FF\uC744 \uBA39\uC774\uACA0\uB2E4\uB294 \uC758\uB3C4\uB85C \uB2D8\uC758 \uC0AC\uC9C4\uACFC \uC2E0\uC0C1\uC815\uBCF4\uB97C \uB137\uC0C1\uC5D0 \uC62C\uB9AC\uBA74\uC11C \"\uB0B4 \uC5EC\uC790\uCE5C\uAD6C\uAC00 \uC774\uB188\uC5D0\uAC8C \uAC15\uAC04\uB2F9\uD588\uC2B5\uB2C8\uB2E4. \uB2E4\uB4E4 \uC870\uC2EC\uD558\uC138\uC694\" \uB77C\uACE0 \uD588\uB2E4\uBA74(\uD5C8\uC704\uC0AC\uC2E4\uC758 \uC801\uC2DC) @seungow",
