  "text" : "\uBC18\uB300\uB85C \uC0DD\uAC01\uD574\uBCF4\uBA74.. \uD615\uBC95\uC774 \uCC98\uBC8C\uD558\uB294 \uAC83\uC740 \uD5C8\uC704\uC0AC\uC2E4\uC744 \uC801\uC2DC\uD558\uC5EC \uBA85\uC608\uB97C \uD6FC\uC190\uD55C\uB2E4\uB358\uAC00, \uC0AC\uC2E4\uC744 \uB9D0\uD588\uB354\uB77C\uB3C4 \uADF8\uAC83\uC774 \uC624\uC9C1 \uC0AC\uC775\uCD94\uAD6C\uB97C \uC704\uD55C \uD589\uC704\uB77C\uC11C \uC774\uB85C \uC778\uD574 \uD0C0\uC778\uC758 \uBA85\uC608 \uBC0F \uC2E0\uC6A9\uC744 \uD6FC\uC190\uC2DC\uCF30\uC744 \uACBD\uC6B0\uB77C\uB294 \uAC83\uC774\uC8E0. \uC774\uAC78 \uCC98\uBC8C \uC548\uD55C\uB2E4\uBA74 \uBB58 \uCC98\uBC8C\uD574\uC694? @seungow",
