  "text" : "\uCDA9\uBD84\uD788 \uB2EC\uC131 \uB420 \uC218 \uC788\uC5B4\uC694. \uC720\uC0AC\uD55C \uD0C0 \uC8C4\uC758 \uBC95\uC815\uD615\uACFC\uC758 \uADE0\uD615\uC744 \uB9DE\uCD98\uB2E4\uB294 \uC774\uC720\uB85C \uBC95\uC815\uD615\uC758 \uC815\uB3C4\uAC00 \uC870\uC808\uB418\uB294 \uC804\uB840\uB4E4\uC774 \uC788\uB2E4\uB294 \uAC83\uC744 \uC0DD\uAC01\uD574\uBCF4\uBA74, \uBC95\uB960 \uADF8 \uC790\uCCB4\uB97C \uB72F\uC5B4\uACE0\uCCD0\uC11C \uD615\uB7C9\uC744 \uB298\uB9AC\uB824\uB294 \uC2DC\uB3C4\uB294 \uC804\uCCB4\uC801\uC778 \uD615\uBC8C\uC758 \uACFC\uB3C4\uD654\uB97C \uBD88\uB7EC\uC62C \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4. @seungow",
