  "text" : "\uB204\uB204\uC774 \uD558\uB294 \uB9D0\uC774\uC9C0\uB9CC, \uC800\uB294 \uBB34\uC2A8 \uC77C \uC0DD\uAE38 \uB54C\uB9C8\uB2E4 \"\uD615\uBC95\uC744 \uAC1C\uC815\uD558\uB358\uAC00 \uADF8 \uC678 \uD2B9\uBCC4\uBC95\uC744 \uC2E0\uC124\uD574\uC11C \uD615\uB7C9\uC744 \uC99D\uAC00\uC2DC\uCF1C\uC57C \uD55C\uB2E4\"\uACE0 \uC8FC\uC7A5\uD558\uB294 \uBD84\uB4E4 \uBCF4\uBA74 \uC880 \uBB34\uC11C\uC6CC\uC694. \uC6B0\uB9AC \uD615\uBC95\uC740 \uC9C0\uAE08\uB3C4 \uAD1C\uCC2E\uC2B5\uB2C8\uB2E4. \uC8FC\uC7A5\uD558\uC2DC\uB294 \uBD80\uBD84\uC740 \uBC95\uC744 \uACE0\uCE58\uAE30\uBCF4\uB2E4\uB294 \uC591\uD615\uAE30\uC900\uC744 \uC190\uBCF4\uB294 \uAC83\uB9CC\uC73C\uB85C\uB3C4",
