  "text" : "\uC774\uB7EC\uD55C \uAC83\uB4E4\uC774 \uD310\uACB0\uBB38\uC5D0\uC11C \uBCF4\uC774\uB294 \uC591\uD615 \uC774\uC720\uC600\uB2E4\uB294 \uAC83\uC744 \uC0DD\uAC01\uD574 \uBCF8\uB2E4\uBA74, \uC194\uC9C1\uD788 \uB9D0\uD574 \uC9D5\uC5ED 10\uAC1C\uC6D4\uC740 \uC0C1\uB2F9\uD788 \uD30C\uACA9\uC801\uC73C\uB85C \uACBD\uD558\uAC8C \uC120\uACE0\uB41C \uD615\uC774 \uC544\uB2D0\uAE4C \uC2F6\uB124\uC694. \uC804 \uC544\uBB34\uB9AC \uBABB\uD574\uB3C4 \uC9D1\uC720 \uC5C6\uC774 \uC9D5\uC5ED 1\uB144 4\uAC1C\uC6D4 \uC774\uC0C1\uC740 \uC120\uACE0\uB418\uC9C0 \uC54A\uC744\uAE4C \uC0DD\uAC01\uD588\uC5C8\uB294\uB370. @seungow",
