  "text" : "\uB0B4\uC815\uC790 \uBC1C\uD45C\uAC00 \uC7A5\uAD00\uC9C1 \uD655\uC815+\uBD80\uCC98 \uD655\uC815\uC758 \uD45C\uC9C0\uB3C4 \uC544\uB2C8\uACE0, \uC815\uBD80\uC870\uC9C1\uBC95 \uAC1C\uC815\uC548 \uD1B5\uACFC \uC804 \uBC1C\uD45C\uAC00 \uAE08\uC9C0\uB41C \uAC83\uB3C4 \uC544\uB2C8\uACE0, \uC778\uC218\uC704\uC758 \uB0B4\uC815\uC790 \uBC1C\uD45C\uC5D0 \uAD6D\uD68C\uAC00 \uAE30\uC18D\uB418\uC5B4\uC57C \uD560 \uD558\uB4F1\uC758 \uC774\uC720\uAC00 \uC5C6\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uADF8\uAC78 \uC555\uBC15\uC774\uB77C\uACE0 \uD558\uBA74 \uCC38.. \uC57C\uAD8C\uC5D4 \uC804\uC220\uB3C4 \uC5C6\uACE0, \uC804\uB7B5\uB3C4 \uC5C6\uACE0.",
