  "text" : "South Park\uC5D0\uC11C\uB294 \uC624\uBC14\uB9C8\uC640 \uB9E4\uCF00\uC778\uC758 \uB300\uC120 \uCD9C\uB9C8\uC774\uC720\uB294 \uBC15\uBB3C\uAD00\uC758 \uBCF4\uC11D\uC744 \uD6D4\uCE58\uAE30 \uC704\uD55C \uACC4\uD68D\uC73C\uB85C\uC368\uC758 \uC704\uC7A5\uCD9C\uB9C8\uC600\uC73C\uBA70, \uC0AC\uC2E4 \uADF8\uB4E4\uC740 \uD55C\uD328\uC600\uB2E4\uAC70\uB098- \uC624\uBC14\uB9C8\uC758 \uC7AC\uC120 \uC131\uACF5\uC740 \uC5D0\uB9AD \uCE74\uD2B8\uB9E8\uACFC \uC911\uAD6D\uC758 \uBD80\uC815\uC120\uAC70 \uC870\uC791 \uB355\uBD84\uC774\uB77C\uB294 \uC5D0\uD53C\uB97C \uBC29\uC601\uD55C \uC801\uC774 \uC788\uB2E4 @seungow",
