  "text" : "\uADF8\uB9AC\uACE0\uB294 \"65G\uB140? \uADF8\uAC8C \uBB54\uB370? \uBB54 \uC77C \uC788\uC5C8\uC5B4??\" \uB77C\uBA70 \uD0DC\uC5F0\uD788 \uC798 \uC9C0\uB0B4\uB2E4\uAC00, \uC131\uBC94\uC8C4 \uC0AC\uAC74 \uD558\uB098 \uD130\uC9C0\uBA74 \"\uC800 \uBC94\uC8C4\uC790\uB188\uB4E4 \uC131\uAE30\uB97C \uC804\uBD80 \uD130\uCCD0\uBC84\uB824\uC57C \uD574! \uBB50? \uBB34\uAE30\uC9D5\uC5ED? \uB9D0\uB3C4 \uC548\uB3FC.. \uC8FD\uC5EC\uBC84\uB824\uC57C\uC9C0!!\" \uB77C\uACE0\uB4E4 \uD560\uD14C\uACE0. \uB098\uB791 \uB0B4\uAE30\uD569\uC2DC\uB2E4. \uC548\uADF8\uB7F4\uAC83 \uAC19\uC544\uC694??",
