  "text" : "\uC608\uC804\uC5D0\uB294 \uBAA8\uD154\uC5D0 \uB3C4\uBE0C \uC0F4\uD478+\uB3C4\uBE0C \uBC14\uB514\uD074\uB80C\uC800\uAC00 \uB300\uC138\uC600\uB294\uB370(\uADF8\uB798\uC11C \uC720\uB2C8\uB808\uBC84 \uCF54\uB9AC\uC544\uB294 \uC808\uB300 \uB9DD\uD558\uC9C0 \uC54A\uC744 \uAC83\uC774\uB77C \uC0DD\uAC01\uD588\uC5C8\uC74C), \uC5B8\uC820\uAC00\uBD80\uD130 \uC138\uC774\uB098 \uD574\uD53C\uBC14\uC2A4 \uB4F1\uC774 \uB208\uC5D0 \uB744\uAE30 \uC2DC\uC791\uD588\uB2E4. \uC2EC\uC9C0\uC5B4 \uC5BC\uB9C8 \uC804\uC5D0\uB294 \uCF00\uB77C\uC2DC\uC2A4 \uC0F4\uD478\uB098 \uB370\uD1A8 \uBC14\uB514\uD074\uB80C\uC800\uB3C4 \uBD24\uC5B4. \uB0B4\uC6A9\uBB3C\uB3C4 \uB9DE\uACE0.",
