  "text" : "\uD070 \uC6D4\uD480\uC695\uC870\uC5D0 \uD63C\uC790 \uB4E4\uC5B4\uAC00\uC11C \uC790\uB2E4\uAC00\uB294 \uC606\uC73C\uB85C \uC4F0\uB7EC\uC838\uC11C \uD5C8\uC6B0\uC801\uB300\uB294 \uC77C\uC774 \uB2E4\uBC18\uC0AC\uC774\uAE30\uC5D0, \uBAA9\uC695\uC774 \uBAA9\uC801\uC774\uB77C\uBA74 \uAD73\uC774 \uC6D4\uD480\uC695\uC870\uAC00 \uD070 \uB8F8\uC744 \uC7A1\uC744 \uD544\uC694\uB294 \uC5C6\uB2E4. \uBAA9\uC695\uD558\uACE0 \uD479 \uC26C\uAE30\uC5D0\uB294 1\uC778\uC6A9 \uC6D4\uD480\uC695\uC870\uC5D0\uB2E4\uAC00 \uCC3D\uBB38\uB3C4 \uC791\uACE0 \uBC29\uB3C4 \uC791\uC740 \uC2A4\uD0E0\uB2E4\uB4DC\uB8F8\uC774 \uB531 \uC88B\uC544",
