  "text" : "\uC624\uB298 \uC0C8\uBCBD\uC5D0 \uD558\uB358 \uC774\uC57C\uAE30\uB294 \uAC70\uAE30\uC11C \uB04A\uC5B4\uC57C\uC9C0- \uC2F6\uC5C8\uB294\uB370, \uC544\uCE68\uBD80\uD130 \uB610 \uBB54\uAC00\uAC00 \uC2DC\uB04C\uC2DC\uB04C\uD558\uB124. \uB059...\n\n\uC5EC\uD2BC, \uC0AC\uB78C \uC798 \uC54C\uC544\uBCF4\uACE0 \uACB0\uC815\uD574\uC694. \uACB0\uD63C\uD558\uACE0 1\uB144\uB3C4 \uCC44 \uC9C0\uB098\uC9C0 \uC54A\uC544 \uC774\uD63C\uD558\uACE0 \uC2F6\uB2E4\uACE0- \uC5B4\uCA4C\uBA74 \uC88B\uB0D0\uACE0 \uBB3C\uC5B4\uC624\uBA74 \uB108\uB3C4 \uBBFC\uB9DD, \uB098\uB3C4 \uBBFC\uB9DD, \uBD80\uC870\uAE08\uB3C4 \uBBFC\uB9DD..",
