  "text" : "\uADF8\uB798\uC11C \uB0A8\uB4E4\uC740 \uC544\uC774\uC0AC\uC9C4 \uB3C4\uBC30 \uD14C\uB7EC(?;)\uC5D0 \uB059\uB059 \uC553\uB2E4\uAC00 \uADF8\uB0E5 \uD0C8\uD1F4\uB97C \uD55C\uB2E4\uB294\uB370, \uB09C \uADF8\uB0E5 \uACFC\uAC10\uD558\uAC8C \uCE5C\uAD6C\uB04A\uAE30 \uB204\uB984. \uADF8\uB798\uB3C4 \uC790\uAE30 \uC18C\uC2DD\uC758 \uBE44\uC728\uACFC \uC880 \uC870\uD654\uB97C \uC774\uB8EC\uB2E4\uBA74 \uAD1C\uCC2E\uC744\uD150\uB370 \uB9D0\uC774\uC57C. \uD558\uC9C0\uB9CC \uC721\uC544\uAC00 \uC0B6\uC758 \uC804\uBD80\uAC00 \uB41C \uC0C1\uD0DC\uC77C\uD14C\uB2C8...",
