  "text" : "\uB098\uB3C4 \uBB50 \uC774\uB798\uC800\uB798 \uD63C\uB780\uC2A4\uB7EC\uC6E0\uC9C0\uB9CC, \uC790\uB140\uB4E4\uAE4C\uC9C0 \uB098\uC11C \uBAA8\uB97C \uC751\uC6D0\uD55C\uB2E4\uB294\uB370 \uC5B4\uCA4C\uACA0\uB098.. \uADF8\uB798\uC11C \uB0A8\uD3B8\uC774 \uAC00\uC9C0\uACE0 \uC788\uB2E4\uB294 (\uB0B4\uC5F0\uB0A8\uC758 \uCCB4\uC561\uC774 \uBB3B\uC740)\uCE68\uB300 \uC2DC\uD2B8\uB098 \uC18D\uC637, \uADF8\uB9AC\uACE0 \uC624\uD53C\uC2A4\uD154 \uB4E4\uC758 \uC778\uBA78 \uB4F1\uC5D0 \uB300\uD574 \uB17C\uD558\uACE0 \uC788\uB358 \uB3C4\uC911\uC5D0 \uAC11\uC790\uAE30 \uC0AC\uAC74\uC774 \uD558\uB098 \uD130\uC9C0\uAC8C \uB418\uB294\uB370...",
