  "text" : "\uADFC\uB370.. \uADF8 \uC544\uC8FC\uBA38\uB2C8\uC758 \uC790\uB140\uB4E4\uB3C4 \uBAA8\uC758 \uBD88\uB95C \uC0AC\uC2E4\uC744 \uC774\uBBF8 \uC54C\uACE0 \uC788\uC5C8\uACE0- \uC720\uCE58\uC6D0 \uC120\uC0DD\uB2D8\uC774\uB358 \uB538\uC740 \uC801\uADF9\uC801\uC73C\uB85C \uBAA8\uB97C \uC751\uC6D0\uD558\uACE0 \uC788\uACE0, \uACE0\uB4F1\uD559\uAD50 1\uD559\uB144 \uC544\uB4E4\uC740 \uC5B4\uB290 \uD3B8\uC744 \uB4E4\uC5B4\uC57C \uD560 \uC9C0 \uAC08\uD321\uC9C8\uD321 \uD558\uACE0 \uC788\uB358 \uC0C1\uD669. \uB538\uC740 \uB0B4\uAC8C \uC804\uD654\uAE4C\uC9C0 \uD558\uBA74\uC11C \uBB54\uAC00 \uBC29\uBC95\uC774 \uC5C6\uACA0\uB0D0\uACE0..",
