  "text" : "\uADF8\uB798\uC11C \uBB50.. \uC774\uD63C\uC740 \uAC00\uB2A5\uD558\uACA0\uC9C0\uB9CC, \uC30D\uBC29\uC758 \uCC45\uC784\uC774 \uC788\uAE30 \uB54C\uBB38\uC5D0 \uC704\uC790\uB8CC\uB294 \uAE30\uB300\uD558\uAE30 \uD798\uB4E4 \uAC83 \uAC19\uB2E4\uACE0 \uD588\uB354\uB2C8 \uD55C\uC228\uC744 \uD479 \uC26C\uC2DC\uB354\uB77C\uB294. \uC0AC\uC2E4 \uB0B4\uC5F0\uB0A8\uC5D0\uAC8C \uB9C8\uB828\uD574\uC900 \uC624\uD53C\uC2A4\uD154\uB3C4 \uD658\uACBD\uBBF8\uD654\uC6D0\uC774\uC5C8\uB358 \uB0A8\uD3B8\uC758 \uD1F4\uC9C1\uAE08 \uC77C\uBD80\uB97C \uC720\uC6A9\uD574\uC11C \uACC4\uC57D\uD55C \uAC83\uC774\uC5C8\uB358\uC9C0\uB77C \uC704\uC790\uB8CC\uAC00 \uC808\uC2E4\uD558\uC168\uB358..",
