  "text" : "[\uB9AC\uBE59\uD3EC\uC778\uD2B8] \uADF8\uB9AC\uACE0 \uD638\uC2E0\uC6A9\uD488 \uACE0\uB974\uB294 \uD301\uC778\uB370.. \uD638\uC2E0\uC6A9\uD488\uC740 \uAC00\uB2A5\uD558\uBA74 \uB208\uC5D0 \uC798 \uB744\uB294 \uC694\uB780\uD55C \uB514\uC790\uC778\uC77C\uC218\uB85D \uC88B\uC2B5\uB2C8\uB2E4. \uD0C0\uACA9\uC6A9 \uB3CC\uAE30\uAC00 \uBC15\uD600\uC788\uB294 LED \uB79C\uD134\uC774\uB77C\uB358\uAC00, \uACFC\uC7A5\uB41C \uD615\uD0DC\uC758 \uAC00\uC2A4\uCD1D\uCC98\uB7FC \uB2E4\uB978 \uC0AC\uB78C\uC758 \uC774\uBAA9\uC744 \uB044\uB294 \uC81C\uD488\uC744 \uC120\uD0DD\uD558\uB294 \uAC83\uC774 \uC88B\uC2B5\uB2C8\uB2E4.",
