  "text" : "\uC800 \uCF00\uC774\uC2A4\uB294 \uC774\uD63C\uC774 \uC544\uB2CC \uD63C\uC778\uC758 \uC0AC\uC2E4 \uC790\uCCB4\uB97C \uBD80\uC815\uD558\uB294 \uD63C\uC778\uCDE8\uC18C\uB85C \uAC00\uC57C \uC800 \uC5EC\uC131\uC5D0\uAC8C \uC774\uB4DD\uC774 \uB428. \uC774\uD63C\uC740 \uACF5\uBB38\uC11C\uC0C1 \uD63C\uC778\uACFC \uAD00\uB828\uB41C \uAE30\uB85D\uC774 \uB0A8\uAC8C \uB418\uC9C0\uB9CC, \uD63C\uC778\uBB34\uD6A8\uD654 \uD63C\uC778\uCDE8\uC18C\uB294 \uD63C\uC778\uACFC \uAD00\uB828\uB41C \uBAA8\uB4E0 \uAE30\uB85D\uC774 \uC0AD\uC81C- \uC989, \uC560\uCD08\uBD80\uD130 \uD63C\uC778\uC774 \uC5C6\uC5C8\uB358 \uAC83\uC73C\uB85C \uB9AC\uC14B(?;)",
