  "text" : "\uB0A8\uD3B8\uC758 \uC804\uC790\uBC1C\uCC0C\uB97C \uBC1C\uACAC\uD588\uB2E4\uBA74 \uC774\uB294 '\uACB0\uD63C \uB2F9\uC2DC \uB2F9\uC0AC\uC790 \uC77C\uBC29\uC5D0\uAC8C \uBD80\uBD80\uC0DD\uD65C\uC744 \uACC4\uC18D\uD560 \uC218 \uC5C6\uB294 \uC911\uB300\uC0AC\uC720(\uC0C1\uC2B5\uC801\uC778 \uC131\uBC94\uC8C4 \uC131\uD5A5)\uAC00 \uC788\uC74C\uC744 \uC54C\uC9C0 \uBABB\uD55C \uACBD\uC6B0'\uC5D0 \uD574\uB2F9\uD55C\uB2E4\uACE0 \uBCFC \uAC83\uC774\uBBC0\uB85C \uD63C\uC778\uCDE8\uC18C\uC0AC\uC720\uAC00 \uB418\uACE0, \uC548 \uB0A0\uB85C\uBD80\uD130 6\uAC1C\uC6D4\uC774 \uC9C0\uB098\uC9C0 \uC54A\uC558\uC73C\uBBC0\uB85C \uD63C\uC778\uCDE8\uC18C\uCCAD\uAD6C \uAC00\uB2A5",
