  "text" : "\uC6F9\uD558\uB4DC \uB4F1\uC744 \uD1B5\uD55C \uC57C\uB3D9 \uC720\uD3EC \uC2DC, \uC815\uBCF4\uD1B5\uC2E0\uB9DD\uBC95\uC774\uB098 \uC544\uCCAD\uBC95\uC774 \uC544\uB2CC \uC800\uC791\uAD8C\uBC95 \uCE68\uD574\uB85C\uB3C4 \uCC98\uBC8C \uAC00\uB2A5\uD569\uB2C8\uB2E4. \uAD6D\uB0B4\uC5D0 \uC815\uC2DD \uC218\uC785\uC0AC\uB3C4 \uC5C6\uB294 \uBD88\uBC95\uC758 \uC815\uBCF4\uC784\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uC800\uC791\uAD8C\uBC95 \uC704\uBC18\uC73C\uB85C \uCC98\uBC8C \uAC00\uB2A5\uD55C \uC774\uC720\uB294, \uC74C\uB780\uBB3C \uCC3D\uC791\uC790\uC5D0\uAC8C\uB3C4 \uC800\uC791\uAD8C\uC744 \uC778\uC815\uD558\uAE30 \uB54C\uBB38\uC785\uB2C8\uB2E4.",
