  "text" : "\uC131\uBC94\uC8C4\uC790\uB4E4\uC744 \uC695\uD558\uAE30 \uC804\uC5D0 '\uC220\uC744 \uB9C8\uC2E0 \uC5EC\uC790\uAC00 \uC798\uBABB\uC774\uB2E4, \uC637\uC744 \uC800\uB807\uAC8C \uC785\uC740 \uC5EC\uC790\uAC00 \uC798\uBABB\uC774\uB2E4' \uB77C\uB294 \uC0DD\uAC01\uBD80\uD130 \uD558\uB294 \uC800\uB7F0 \uC0AC\uB78C\uB4E4\uC774.. \uD749\uC545\uBC94\uC8C4\uAC00 \uD130\uC9C8 \uB54C\uB9C8\uB2E4 \uD53C\uD574\uC790\uC758 \uC778\uAD8C\uC774 \uC5B4\uCA4C\uACE0 \uC800\uCA4C\uACE0 \uD558\uBA74\uC11C \uB5A0\uB4E4\uC5B4\uB308 \uAC83\uC774\uB77C\uACE0 \uC0DD\uAC01\uD558\uBA74 \uC554\uB2F4\uD558\uB2E4. \uC815\uB9D0 \uB2F5\uC774 \uC5C6\uC5B4.",
