  "text" : "[\uAD70\uB300\uAD34\uB2F4] KTA \uBC30\uB7ED \uAC01 \uBC29\uC758 \uAD6C\uC11D\uAD6C\uC11D\uC744 \uC798 \uC0B4\uD3B4\uBCF4\uBA74, \uC9C1\uC804 \uAE30\uC218\uAC00 \uB0A8\uACA8\uB193\uACE0 \uAC04 \uD301\uC774\uB77C\uB358\uAC00 \uC774\uC804 \uAE30\uC218\uC758 \uC790\uB300\uBC30\uCE58 \uC815\uBCF4 \uB4F1\uC744 \uB4DD\uD15C\uD560 \uC218 \uC788\uC74C. \uC9C1\uC804 \uAE30\uC218\uC758 KTA\uC131\uC801\uC774\uB098 \uB300\uD559, \uC804\uACF5 \uB4F1\uC744 \uBCF4\uBA74\uC11C \uC790\uC2E0\uC758 \uC55E\uB0A0\uC744 \uC5B4\uB834\uD48B\uC774 \uC608\uC0C1\uD574 \uBCF4\uAE30\uB3C4.. (\uC548\uB9DE\uC2B5\uB2C8\uB2E4)",
