  "text" : "[\uAD70\uB300\uAD34\uB2F4] KTA\uC5D0 \uAC00\uBA74 3\uC778 1\uC2E4\uC758 \uC219\uC18C\uB97C \uBC30\uC815\uBC1B\uC544 \uC4F0\uAC8C \uB418\uB294\uB370, \uB17C\uC0B0\uC5D0\uC11C 12\uC778 1 \uC0DD\uD65C\uAD00\uC744 \uC4F0\uB358 \uCE74\uD22C\uC0AC\uB4E4\uC5D0\uAC8C\uB294 \uD654\uC7A5\uC2E4\uACFC \uC695\uC870\uAC00 \uB538\uB9B0 \uBC30\uB7ED\uC740 \uC0AC\uCE58\uC758 \uADF9\uCE58\uB97C \uB2EC\uB9AC\uB294 \uC2DC\uC124. \uB0C9\uB09C\uBC29\uC744 \uBBF8\uCE5C\uB4EF\uC774 \uD574\uC11C \uC5EC\uB984\uC5D0\uB294 \uAC1C\uCDA5\uACE0, \uACA8\uC6B8\uC5D0\uB294 \uAC1C\uB365\uC2B5\uB2C8\uB2E4.",
