  "text" : "[\uAD70\uB300\uAD34\uB2F4] \uADF8\uB9AC\uACE0 KTA\uC5D0\uC11C \uC790\uB300\uBC30\uCE58\uB97C \uBC1B\uAC8C \uB418\uB294\uB370, \uC774 \uC790\uB300\uBC30\uCE58 \uACB0\uACFC\uC5D0 \uB530\uB77C \uBBF82\uC0AC\uB2E8,\uC6A9\uC0B0,\uD3C9\uD0DD,\uB300\uAD6C \uB85C\uC758 \uADFC\uBB34\uC9C0\uAC00 \uACB0\uC815\uB418\uAC8C \uB41C\uB2E4. \uC9E7\uB2E4\uBA74 \uC9E7\uACE0, \uAE38\uB2E4\uBA74 \uAE34 2\uB144\uC5D0 \uAC00\uAE4C\uC6B4 \uAD70\uBCF5\uBB34 \uAE30\uAC04\uC744 \uC5B4\uB514\uC5D0\uC11C \uBCF4\uB0B4\uAC8C \uB418\uB290\uB0D0\uB294 \uB204\uAD6C\uC5D0\uAC8C\uB098 \uCD5C\uB300\uC758 \uAD00\uC2EC\uAC70\uB9AC.",
