  "text" : "\uBCF4\uC774\uC800 2\uD638\uB294 \uC774\uC2DC\uAC01 \uD604\uC7AC \uC9C0\uAD6C\uC5D0\uC11C 15,189,931,591 KM \uB5A8\uC5B4\uC9C4 \uACF3\uC744 \uBE44\uD589 \uC911\uC785\uB2C8\uB2E4. \uC9C0\uAE08 \uC774 \uC21C\uAC04\uC5D0\uB3C4 \uADF8 \uAC70\uB9AC\uB294 \uC810\uC810 \uBA40\uC5B4\uC9C0\uACE0 \uC788\uAD6C\uC694. \uC5B8\uC820\uAC00\uB294 \uD1B5\uC2E0\uB3C4 \uB04A\uACA8 \uC6B0\uB9AC\uC5D0\uAC8C\uC11C \uC78A\uD600\uC9C0\uACA0\uC9C0\uB9CC, \uADF8\uB798\uB3C4 \uBCF4\uC774\uC800\uB294 \uACC4\uC18D \uB0A0\uC544\uAC08\uAC81\uB2C8\uB2E4. \uC54C \uC218 \uC5C6\uB294 \uADF8\uACF3\uC73C\uB85C",
