  "text" : "\uC5EC\uD2BC, \uB0B4\uAC00 \uC880\uC804\uAE4C\uC9C0 \uD558\uACE0 \uC788\uB358 \uBAA9\uB3C4\uB9AC\uC5D0 \uC5BC\uAD74\uC744 \uD30C\uBB3B\uACE0 \uD5A5\uAE30\uB97C \uB9E1\uACE0 \uC788\uB294 \uBAA8\uC2B5\uC740 \uB2E4\uB4E4 \uB9E4\uC6B0 \uB7EC\uBE14\uB9AC\uD588\uC5C8\uB358 \uAC83 \uAC19\uB2E4. \uADF8\uB9AC\uACE0 \uADF8\uB807\uAC8C \uB0B4 \uBB3C\uAC74\uC744 \uBE7C\uC557\uACA8\uB3C4, \uADF8\uB54C\uB9C8\uB2E4 \uC0C8\uAC78 \uBC1B\uC558\uC73C\uB2C8 \uD070 \uBD88\uB9CC \uC5C6\uC74C. (\uC57C, \uADF8\uB807\uB2E4\uACE0 \uB0B4\uAC00 \uC0C8\uAC78 \uBC1B\uC790\uACE0 \uC77C\uBD80\uB7EC \uAC74\uB124\uC900\uAC74 \uC544\uB2C8\uC57C)",
