  "text" : "\uD2B9\uD788 \uB0B4\uAC00 \uC4F0\uB358 \uBAA9\uB3C4\uB9AC\uB294 \uB098\uC640 \uACA8\uC6B8\uC5D0 \uB9CC\uB09C \uC0AC\uB78C\uB4E4\uC5D0\uAC90 MUST STEAL(-_-) \uC544\uC774\uD15C\uC774\uC5C8\uB358 \uB4EF. \uC0AC\uC2E4 \uB098\uB3C4 \uADF8 \uC810\uC744 \uC54C\uAE30 \uB54C\uBB38\uC5D0 '\uB108\uB3C4 \uB098\uC758 \uD5A5\uAE30\uC5D0 \uBE60\uC838 \uD5C8\uC6B0\uC801\uAC70\uB824\uBD10\uB77C' \uB77C\uBA70 \uB0B4 \uBAA9\uB3C4\uB9AC\uB97C \uAC74\uB124\uC92C\uC5C8... \uC544\uB2D9\uB2C8\uB2E4. \uBABB\uB4E4\uC740 \uAC78\uB85C \uD558\uC2DC\uC838.",
