  "text" : "\uADF8\uB798\uC11C\uC778\uC9C0 \uB300\uBD80\uBD84\uC758 \uAD6C\uC5EC\uCE5C\uB2D8\uB4E4\uAED8\uC11C\uB294 \uB0B4\uAC00 \uC9D1\uC5D0\uC11C \uD3B8\uD558\uAC8C \uC785\uACE0 \uC788\uB358 \uD2F0\uC154\uCE20\uB098 \uB9E8\uD22C\uB9E8\uD2F0\uC154\uCE20 \uB4F1\uC758 \uC637\uC744 \uD558\uB098\uC529 \uBE7C\uC557\uC544 \uAC00\uC168\uB2E4. \uC7A0\uC790\uB9AC\uC5D0 \uB204\uC6CC\uC11C \uB0B4 \uC637\uC5D0\uC11C \uB098\uB294 \uD5A5\uAE30\uB97C \uB9E1\uACE0 \uC788\uC73C\uBA74 \uB9C8\uC74C\uC774 \uD3B8\uD574\uC9C0\uACE0, \uC7A0\uB3C4 \uC194\uC194 \uC628\uB314\uAE14...",
