  "text" : "\uD53C\uBD80\uC5D0 \uC544\uBB34\uAC83\uB3C4 \uBC14\uB974\uC9C0 \uC54A\uC740 \uC0C1\uD0DC, \uD639\uC740 \uC53B\uACE0 \uB098\uC654\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uC6B8\uD2B8\uB77C\uCF00\uC5B4\uC758 \uD5A5\uAE30\uAC00 \uD53C\uBD80 \uC790\uCCB4\uC5D0\uC11C \uC740\uC740\uD558\uAC8C \uB098\uB294\uAC78 \uBCF4\uBA74 \uB9D0\uC774\uC9C0. \uADF8 \uD3B8\uB9AC\uD55C \uC790\uCCB4 \uBC1C\uD5A5 \uAE30\uB2A5(?)\uB355\uBD84\uC5D0 \uB0B4\uAC00 \uD5A5\uC218\uC5D0 \uD070 \uC695\uC2EC\uC774 \uC5C6\uC74C.",
