  "text" : "\uB0A8\uB4E4\uC758 \uC774\uC57C\uAE30\uC5D0 \uC758\uD558\uBA74 (\uADF8\uB9AC\uACE0 \uB0B4\uAC00 \uC0DD\uAC01\uD574\uBD10\uB3C4) \uB0B4 \uD53C\uBD80\uC5D0\uC11C\uB294 \uAF64 \uC88B\uC740 \uD5A5\uAE30\uAC00 \uB098\uB294 \uAC83 \uAC19\uB2E4. \uAC74\uC870\uD55C \uD53C\uBD80 \uB54C\uBB38\uC5D0 \uC5B4\uB824\uC11C\uBD80\uD130 \uAFB8\uC900\uD788 \uBCA0\uC774\uBE44 \uB85C\uC158- \uD2B9\uD788 \uC6B8\uD2B8\uB77C \uCF00\uC5B4\uB97C \uBC1C\uB77C\uC654\uB354\uB2C8, \uC5B8\uC820\uAC00\uBD80\uD130 \uD53C\uBD80 \uC18D\uAE4C\uC9C0 \uADF8 \uD5A5\uAE30\uAC00 \uBC30\uC778 \uAC83 \uAC19\uB2E4.",
